import React from "react";
import "./Masthead.css";

export class Masthead extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: this.props.username,
    };
  }
  state = {
    username: "Sample_Username",
  };

  render() {
    //var logoImage = "./MastheadImages/CluelessLogo";
    var logoImage = "./CardImages/Ballroom.png";
    return (
      <div class="masthead">
        <span class="logo">
          <img src={logoImage} />
        </span>
      </div>
    );
  }
}

export default Masthead;
